backend.tf.code:
terraform {
  backend "s3" {
    bucket = "cloud-ai-demo-infra"
    key    = "cloud-ai/terraform.tfstate"
    region = "us-east-1"
    # Optionally add encryption
    encrypt = false
    # Optionally enable DynamoDB for state locking
    # dynamodb_table = "my-lock-table"
  }
}

./module/vpc/main.tf.code:
resource "aws_vpc" "main" {
  cidr_block           = var.vpc_cidr
  enable_dns_hostnames = true
  enable_dns_support   = true

  tags = {
    Name = var.vpc_name
  }
}

resource "aws_subnet" "public" {
  count             = length(var.public_subnets_cidr)
  vpc_id            = aws_vpc.main.id
  cidr_block        = var.public_subnets_cidr[count.index]
  map_public_ip_on_launch = true
  availability_zone = element(var.availability_zones, count.index)

  tags = {
    Name = "${var.vpc_name}-public-${count.index + 1}"
  }
} 

resource "aws_internet_gateway" "gw" {
  vpc_id = aws_vpc.main.id

  tags = {
    Name = "${var.vpc_name}-igw"
  }
}

resource "aws_route_table" "public" {
  vpc_id = aws_vpc.main.id

  route {
    cidr_block = "0.0.0.0/0"
    gateway_id = aws_internet_gateway.gw.id
  }
}

resource "aws_route_table_association" "public" {
  count = length(aws_subnet.public)

  subnet_id      = aws_subnet.public[count.index].id
  route_table_id = aws_route_table.public.id
}

./module/vpc/variables.tf.code:
variable "vpc_cidr" {
  type        = string
  description = "CIDR for the VPC"
}

variable "public_subnets_cidr" {
  type        = list(string)
  description = "List of CIDR blocks for the public subnets"
}

variable "availability_zones" {
  type        = list(string)
  description = "List of availability zones in the region"
}

variable "vpc_name" {
  type        = string
  description = "Name of the VPC"
}

./module/vpc/outputs.tf.code:
output "vpc_id" {
  value       = aws_vpc.main.id
  description = "ID of the VPC"
}

output "public_subnets_ids" {
  value       = aws_subnet.public.*.id
  description = "List of IDs of the public subnets"
}

output "internet_gateway_id" {
  value       = aws_internet_gateway.gw.id
  description = "ID of the Internet Gateway"
}

./module/ec2/main.tf.code:
resource "aws_security_group" "alb_sg" {
  name        = var.alb_security_group_name
  description = "Security Group for ALB"
  vpc_id      = var.vpc_id

  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    cidr_blocks = ["0.0.0.0/0"]
  }

  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_security_group" "ec2_sg" {
  name        = var.ec2_security_group_name
  description = "Security Group for EC2 Instances"
  vpc_id      = var.vpc_id

  # Allow inbound HTTP from ALB
  ingress {
    from_port   = 80
    to_port     = 80
    protocol    = "tcp"
    security_groups = [aws_security_group.alb_sg.id]
  }

  # Allow all outbound traffic
  egress {
    from_port   = 0
    to_port     = 0
    protocol    = "-1"
    cidr_blocks = ["0.0.0.0/0"]
  }
}

resource "aws_launch_configuration" "ec2_lc" {
  name_prefix   = "lc-${var.app_name}-"
  image_id      = var.ami_id
  instance_type = var.instance_type
  security_groups = [aws_security_group.ec2_sg.id]

  user_data = <<-EOF
              #!/bin/bash
              echo "Hello, Cloud-AI!" > index.html
              nohup busybox httpd -f -p ${var.server_port} &
              EOF

  lifecycle {
    create_before_destroy = true
  }
}

resource "aws_autoscaling_group" "ec2_asg" {
  launch_configuration    = aws_launch_configuration.ec2_lc.id
  vpc_zone_identifier     = var.subnets
  min_size                = var.asg_min_size
  max_size                = var.asg_max_size
  desired_capacity        = var.asg_desired_capacity
  health_check_type       = "EC2"
  health_check_grace_period = 300
  force_delete            = true
  target_group_arns       = [aws_lb_target_group.asg_tg.arn]

  tag {
    key                 = "Name"
    value               = var.app_name
    propagate_at_launch = true
  }
}

resource "aws_lb" "alb" {
  name               = "alb-${var.app_name}"
  internal           = false
  load_balancer_type = "application"
  security_groups    = [aws_security_group.alb_sg.id]
  subnets            = var.subnets

  enable_deletion_protection = false
}

resource "aws_lb_target_group" "asg_tg" {
  name        = "tg-${var.app_name}"
  port        = var.server_port
  protocol    = "HTTP"
  vpc_id      = var.vpc_id
  target_type = "instance"

  health_check {
    interval            = 30
    path                = "/"
    timeout             = 5
    healthy_threshold   = 2
    unhealthy_threshold = 2
    matcher             = "200"
  }
}

resource "aws_lb_listener" "front_end" {
  load_balancer_arn = aws_lb.alb.arn
  port              = "80"
  protocol          = "HTTP"

  default_action {
    type             = "forward"
    target_group_arn = aws_lb_target_group.asg_tg.arn
  }
}

./module/ec2/variables.tf.code:
variable "vpc_id" {
  type        = string
  description = "The VPC ID where resources will be deployed"
}

variable "subnets" {
  type        = list(string)
  description = "The subnets for the autoscaling group"
}

variable "ami_id" {
  type        = string
  description = "The AMI ID to use for the instances"
}

variable "instance_type" {
  type        = string
  description = "Instance type to use for the EC2 instances"
}

variable "app_name" {
  type        = string
  description = "Name of the application for tagging"
}

variable "alb_security_group_name" {
  type        = string
  description = "Name of the security group for the ALB"
}

variable "ec2_security_group_name" {
  type        = string
  description = "Name of the security group for the EC2 instances"
}

variable "asg_min_size" {
  type        = number
  description = "Minimum size of the autoscaling group"
}

variable "asg_max_size" {
  type        = number
  description = "Maximum size of the autoscaling group"
}

variable "asg_desired_capacity" {
  type        = number
  description = "Desired size of the autoscaling group"
}

variable "server_port" {
  type        = number
  default     = 80
  description = "The port the server will use for HTTP requests"
}

./module/ec2/outputs.tf.code:
output "alb_dns_name" {
  value       = aws_lb.alb.dns_name
  description = "The DNS name of the ALB"
}

